import React from "react";

function AboutEcSharing() {
  return (
    <ContentBlock>
      <AboutEcImg url={"images/Sharing.png"} />
      <AboutEcMainText>Sharing</AboutEcMainText>
      <AboutEcSubText>
        EC는 개인의 지식과 경험을 공유하는 장이 되어줍니다.
      </AboutEcSubText>
    </ContentBlock>
  );
}

export default AboutEcSharing;
